import './index.scss';

import React from 'react';

const Project = ({project}) =>{
    return (
        <div className='projects-section'>
            
            <h3>{project.title}</h3>
            <h3>{project.date}</h3>
            <h3>{project.tools}</h3>
            <p>{project.description}</p>


        </div>
    )

} 

export default Project;
